  console.log("Here in about");
  return (
    <div className="About">
      <Container className="align-items-center">
        <Row>
          <Col className="col-md-4">
            <img src={me_pic} alt="Robert Knox" />
          </Col>
          <Col className="col-md-2"></Col>
          <Col className="col-md-4">
            <img src={me_pic} alt="Robert Knox" />
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default about;
